// delete alert
function delette(thing) {
  Swal.fire({
  title: 'Are you sure?',
  text: "You won't be able to delete "+thing+"!",
  type: 'warning',
  showCancelButton: true,
  confirmButtonColor: '#3085d6',
  cancelButtonColor: '#d33',
  confirmButtonText: 'Yes, delete it!'
}).then((result) => {
  if (result.value) {
    Swal.fire(
      'Deleted!',
      'Your file has been deleted.',
      'success'
    )
  }
})
  }
function confirrm(thing) {
  Swal.fire({
  title: 'Are you sure?',
  text: " to "+thing+"!",
  type: 'success',
  showCancelButton: true,
  confirmButtonColor: '#3085d6',
  cancelButtonColor: '#d33',
  confirmButtonText: 'Yes'
}).then((result) => {
  if (result.value) {
    Swal.fire(
      'confirmed!',
      'success'
    )
  }
})
  }
