function readURL(input,imgSelector) {
  if (input.files && input.files[0]) {
      var reader = new FileReader();

      reader.onload = function (e) {
          $(imgSelector).attr('src', e.target.result);
      }

      reader.readAsDataURL(input.files[0]);
  }
}
$('i.fa-eye').on('click', function(){
  if($(this).parents('.input-group-prepend').next().attr('type') == 'password'){
    $(this).parents('.input-group-prepend').next().attr('type', 'text')
  }else {
    $(this).parents('.input-group-prepend').next().attr('type', 'password')
  }
})

var $star_rating = $('.star-rating .far');

var SetRatingStar = function() {
  return $star_rating.each(function() {
    if (parseInt($star_rating.siblings('input.rating-value').val()) >= parseInt($(this).data('rating'))) {
      return $(this).removeClass('far').addClass('fas');
    } else {
      return $(this).removeClass('fas').addClass('far');
    }
  });
};

$star_rating.on('click', function() {
  $star_rating.siblings('input.rating-value').val($(this).data('rating'));
  return SetRatingStar();
});

SetRatingStar();

